// src/pages/ProductListPage.js
import React from 'react';
import ProductCard from '../components/productcard';

const ProductListPage = () => {
  // Sample data, replace with real product data
  const products = [
    { id: 1, name: 'Plant A', price: 10, image: 'path/to/imageA.jpg', category: 'Indoor' },
    { id: 2, name: 'Plant B', price: 15, image: 'path/to/imageB.jpg', category: 'Outdoor' },
    { id: 3, name: 'Plant C', price: 20, image: 'path/to/imageC.jpg', category: 'Succulent' },
    // Add more products
  ];

  return (
    <div>
      <h2>Product List</h2>
      <div className="product-list">
        {products.map(product => (
          <ProductCard key={product.id} product={product} />
        ))}
      </div>
    </div>
  );
};

export default ProductListPage;
